(7, 1, 'Return and Replacement', '&lt;p&gt;Refunds, Returns, and Exchanges:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Should you wish to refund, return, or exchange your order, please contact us at (sales@solitairejew.com) for assistance.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To be eligible for a return, items must be received by Solitaire Jewelry within 15 days. The items must also be unworn and in their original packaging. Please note that any shipping fees for returns will be your responsibility.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Warranty:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We are proud to offer a 6-month warranty on all Solitaire Jewelry products from the date of purchase. Our commitment to quality ensures that you receive exceptional pieces that meet your satisfaction. In the event that your piece becomes broken, we will happily repair it at no cost to you. Please note that our warranty does not cover general wear and tear or lost stones, and we cannot accept returns for items that have been altered by a third-party jeweler.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;If you wish to exchange an item under warranty, please contact us at (sales@solitairejew.com).&lt;/p&gt;', 'Return and Replacement', '', '');
