(7, 10, 'Export/Import Tool (V4.13) for OpenCart 3.x', 'Export/Import Tool (V4.13) for OpenCart 3.x', 'mhccorp.com', '3.x-4.13', 'https://www.mhccorp.com', '<modification>\n	<name>Export/Import Tool (V4.13) for OpenCart 3.x</name>\n	<code>Export/Import Tool (V4.13) for OpenCart 3.x</code>\n	<version>3.x-4.13</version>\n	<author>mhccorp.com</author>\n	<link>https://www.mhccorp.com</link>\n	<file path=\"admin/controller/common/column_left.php\">\n		<operation>\n			<search><![CDATA[if ($this->user->hasPermission(\'access\', \'tool/upload\')) {]]></search>\n			<add position=\"before\"><![CDATA[\n			if ($this->user->hasPermission(\'access\', \'extension/export_import\')) {\n				$maintenance[] = array(\n					\'name\'     => $this->language->get(\'text_export_import\'),\n					\'href\'     => $this->url->link(\'extension/export_import\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n					\'children\' => array()\n				);\n			}\n			]]></add>\n		</operation>\n	</file>\n	<file path=\"admin/language/*/common/column_left.php\">\n		<operation>\n			<search><![CDATA[$_[\'text_backup\']]]></search>\n			<add position=\"after\"><![CDATA[\n$_[\'text_export_import\']             = \'Export / Import\';\n			]]></add>\n		</operation>\n	</file>\n</modification>\n', 1, '2022-11-22 05:56:22'),
(11, 16, 'BestPrice 360 Analytics', 'bestprice-analytics', 'BestPrice', '1.0.4', 'http://www.bestprice.gr', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n  <name>BestPrice 360 Analytics</name>\r\n  <code>bestprice-analytics</code>\r\n  <version>1.0.4</version>\r\n  <author>BestPrice</author>\r\n  <link>http://www.bestprice.gr</link>\r\n  <file path=\"catalog/model/checkout/order.php\">\r\n    <operation>\r\n      <search><![CDATA[public function getOrder($order_id) {]]></search>\r\n      <add position=\"before\"><![CDATA[\r\n        public function getBA($order_id) {\r\n            $order_query = $this->db->query(\"SELECT o.order_id, o.language_id, o.total FROM `\" . DB_PREFIX . \"order` o WHERE o.order_id = \'\" . (int)$order_id . \"\'\");\r\n            if ($order_query->num_rows) {\r\n                $language_id = $order_query->row[\'language_id\'];\r\n\r\n				$analytics_bestprice_tax_class_id = $this->config->get(\"analytics_bestprice_tax_class_id\");\r\n				\r\n				$sum_product_price = 0;\r\n				$sum_product_tax = 0;\r\n				\r\n                $order_product_query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"order_product WHERE order_id = \'\" . (int)$order_id . \"\'\");\r\n                \r\n				foreach ($order_product_query->rows as $product) {\r\n                    \r\n					$analytics_bestprice_feed_id = $this->config->get(\"analytics_bestprice_feed_id\");\r\n					\r\n					$product_data = $this->getProductData($product[\'product_id\']);\r\n					$product_id = $product_data[$analytics_bestprice_feed_id];\r\n					\r\n					if ($product[\'tax\'] == 0) {\r\n						$sum_product_price += $product[\'price\'];\r\n						$sum_product_tax += $this->calculateTax($analytics_bestprice_tax_class_id, $product[\'price\']);\r\n						\r\n						$products[] = array(\r\n							\'productId\' => $product_id,\r\n							\'title\' => $product[\'name\'],\r\n							\'price\' => $product[\'price\'],\r\n							\'quantity\' => $product[\'quantity\']\r\n						);\r\n					} else {\r\n						$sum_product_price += $product[\'price\'] + $product[\'tax\'];\r\n						$sum_product_tax += $product[\'tax\'];\r\n						\r\n						$products[] = array(\r\n							\'productId\' => $product_id,\r\n							\'title\' => $product[\'name\'],\r\n							\'price\' => $product[\'price\'] + $product[\'tax\'],\r\n							\'quantity\' => $product[\'quantity\']\r\n						);\r\n					}\r\n                }\r\n\r\n                $order_shipping = 0;\r\n				$order_shipping_tax = 0;\r\n				$order_tax = 0;\r\n				\r\n                $order_total_query = $this->db->query(\"SELECT * FROM `\" . DB_PREFIX . \"order_total` WHERE order_id = \'\" . (int)$order_id . \"\' ORDER BY sort_order ASC\");\r\n                foreach ($order_total_query->rows as $total) {\r\n                    if ($total[\'value\'] > 0) {\r\n                        if ($total[\'code\'] == \"shipping\") {\r\n							if (isset($this->session->data[\"shipping_method\"][\"tax_class_id\"]) && $this->session->data[\"shipping_method\"][\"tax_class_id\"] != 0) {\r\n								$order_shipping = round($this->tax->calculate($total[\"value\"], $this->session->data[\"shipping_method\"][\"tax_class_id\"]), 2);\r\n								$order_shipping_tax = $order_shipping - $total[\"value\"];\r\n							} else {\r\n								$order_shipping = $total[\'value\'];\r\n								$order_shipping_tax = $this->calculateTax($analytics_bestprice_tax_class_id, $total[\'value\']);\r\n							}			\r\n                        }\r\n                    }\r\n                }\r\n\r\n                return array(\r\n                    \'orderId\' => $order_query->row[\'order_id\'],\r\n                    \'revenue\' => $sum_product_price + $order_shipping,\r\n                    \'shipping\' => $order_shipping,\r\n					\'tax\' => round($sum_product_tax + $order_shipping_tax, 2),\r\n                    \'items\' => $products\r\n                );\r\n            } else {	\r\n                return false;\r\n            }\r\n        }\r\n		\r\n		public function getProductData($product_id)\r\n		{\r\n			$product_query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"product WHERE product_id=\'\" . $product_id . \"\'\");\r\n			if ($product_query->num_rows) {\r\n				return $product_query->row;\r\n			}\r\n			return false;\r\n		}\r\n		\r\n		public function calculateTax($tax_class_id, $amount)\r\n		{\r\n			$tax_rule_query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"tax_rule WHERE tax_class_id=\'\" . $tax_class_id . \"\'\");\r\n			$tax_rate_id = $tax_rule_query->row[\"tax_rate_id\"];\r\n			\r\n			$tax_rate_query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"tax_rate WHERE tax_rate_id=\'\" . $tax_rate_id . \"\'\");\r\n			return $amount - ($amount / (1 + $tax_rate_query->row[\"rate\"] / 100));\r\n		}\r\n		\r\n      ]]></add>\r\n    </operation>\r\n  </file>\r\n  <file path=\"catalog/controller/checkout/success.php\">\r\n    <operation>\r\n      <search><![CDATA[public function index() {]]></search>\r\n      <add position=\"after\"><![CDATA[\r\n        $data[\'bp_event\'] = \'\';\r\n\r\n        if (isset($this->session->data[\'order_id\'])) {\r\n            $bp = false;\r\n\r\n            if ($this->config->get(\'analytics_bestprice_status\')) {\r\n                $bp = true;\r\n            } else if ($this->config->get(\'config_analytics_bestprice_status\')) {\r\n                $bp = true;\r\n            } else if ($this->config->get(\'config_analytics_bestprice\')) {\r\n                $bestprice_analytics = $this->config->get(\'config_analytics_bestprice\');\r\n                if (!empty($bestprice_analytics)) {\r\n                    $bp = true;\r\n                }\r\n            }\r\n\r\n            if ($bp) {\r\n                $this->load->model(\'checkout/order\');\r\n                $event_info = $this->model_checkout_order->getBA($this->session->data[\'order_id\']);\r\n\r\n                if ($event_info) {\r\n					$data[\'bp_event\'] .= \"<!-- BestPrice 360 Analytics Order Products Script Start -->\".\"\\n\";\r\n                    $data[\'bp_event\'] .= \"<script>\" . \"\\n\";\r\n					\r\n					$data[\'bp_event\'] .= \"bp(\'addOrder\', {\r\n						\'orderId\': \'\" . $event_info[\'orderId\'] . \"\',         // Transaction ID. Required\r\n						\'revenue\': \'\" . $event_info[\'revenue\'] . \"\',           // Grand Total\r\n						\'shipping\': \'\" . $event_info[\'shipping\'] . \"\', // Shipping\r\n						\'tax\': \'\" . $event_info[\'tax\'] . \"\'           // Tax\r\n					});\" . \"\\n\";\r\n					\r\n					if (isset($event_info[\'items\']) && is_array($event_info[\'items\'])) {\r\n						foreach ($event_info[\'items\'] as $item) {\r\n						\r\n							$data[\'bp_event\'] .= \"bp(\'addProduct\', {\";\r\n							$data[\'bp_event\'] .= \"\'orderId\': \'\" . $event_info[\'orderId\'] . \"\',\";\r\n							$data[\'bp_event\'] .= \"\'productId\': \'\" . htmlspecialchars($item[\'productId\'], ENT_QUOTES) . \"\',\";\r\n							$data[\'bp_event\'] .= \"\'title\': \'\" . htmlspecialchars($item[\'title\'], ENT_QUOTES) . \"\',\";\r\n							$data[\'bp_event\'] .= \"\'price\': \'\" . $item[\'price\'] . \"\',\";\r\n							$data[\'bp_event\'] .= \"\'quantity\': \'\" . $item[\'quantity\'] . \"\'\";\r\n							$data[\'bp_event\'] .= \"});\" .\"\\n\";\r\n						}\r\n                    }\r\n					\r\n                    $data[\'bp_event\'] .= \"</script>\" . \"\\n\";\r\n					$data[\'bp_event\'] .= \"<!-- BestPrice 360 Analytics Order Products Script End -->\";\r\n                }\r\n            }\r\n        }\r\n      ]]></add>\r\n    </operation>\r\n  </file>\r\n  <file path=\"catalog/view/theme/*/template/common/success.twig\">\r\n    <operation>\r\n      <search><![CDATA[{{ footer }}]]></search>\r\n     <add position=\"before\"><![CDATA[\r\n{% if bp_event %}{{ bp_event }}{% endif %}\r\n      ]]></add>\r\n    </operation>\r\n  </file>\r\n	\r\n</modification>', 1, '2023-05-27 15:49:08'),
(9, 14, 'Filter Products By Category', 'owdAdminProductsByCategoryFilter', 'Oleg Kononchuk', '1.4', 'http://buymeacoff.ee/D0daCsFcQ', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n    <name>Filter Products By Category</name>\r\n    <code>owdAdminProductsByCategoryFilter</code>\r\n    <version>1.4</version>\r\n    <author>Oleg Kononchuk</author>\r\n    <link>http://buymeacoff.ee/D0daCsFcQ</link>\r\n\r\n    <file path=\"admin/controller/catalog/product.php\">\r\n        <operation>\r\n            <search><![CDATA[protected function getList() {]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n                if (isset($this->request->get[\'filter_category\'])) {\r\n                    $filter_category = $this->request->get[\'filter_category\'];\r\n                } else {\r\n                    $filter_category = \'\';\r\n                }\r\n            ]]></add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[$url = \'\';]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n            if (isset($this->request->get[\'filter_category\'])) {\r\n				$url .= \'&filter_category=\' . $this->request->get[\'filter_category\'];\r\n			}\r\n            ]]></add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[$data[\'filter_model\'] = $filter_model;]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                $data[\'filter_category\'] = $filter_category;\r\n            ]]></add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[\'filter_model\'	  => $filter_model,]]></search>\r\n            <add position=\"before\"><![CDATA[\'filter_category\'	  => $filter_category,]]></add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[$data[\'sort\'] = $sort;]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                $data[\'text_category\'] = \"Category\";\r\n                $data[\'categories\'] = array();\r\n                $this->load->model(\'catalog/category\');\r\n                $cat_filter = array(\'sort\' => \'name\', \'order\'=> \'ASC\');\r\n                $results = $this->model_catalog_category->getCategories($cat_filter);\r\n                foreach ($results as $result) {\r\n                    $data[\'categories\'][] = array(\r\n                        \'category_id\' => $result[\'category_id\'],\r\n                        \'name\'        => $result[\'name\'],\r\n                    );\r\n                }\r\n                array_unshift($data[\'categories\'], array(\'category_id\' => \'no_cat\', \'name\' => \'Without category\'));\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <file path=\"admin/model/catalog/product.php\">\r\n        <operation>\r\n            <search><![CDATA[$sql = \"SELECT * FROM \" . DB_PREFIX . \"product p LEFT JOIN \" . DB_PREFIX . \"product_description pd ON (p.product_id = pd.product_id) WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\'\";]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n                /*** start owdAdminProductsByCategoryFilter ***/\r\n                $sql = \"SELECT * FROM \" . DB_PREFIX . \"product p LEFT JOIN \" . DB_PREFIX . \"product_description pd ON (p.product_id = pd.product_id)\";\r\n\r\n                $and_sql = \'\';\r\n                if ( isset($data[\'filter_category\']) && $data[\'filter_category\'] !== \'\' ) {\r\n                    if($data[\'filter_category\'] !== \'no_cat\'){\r\n                        $sql .= \" LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p.product_id = p2c.product_id)\";\r\n                        $and_sql = \" AND p2c.category_id = \'\" . (int)$data[\'filter_category\'] . \"\'\";\r\n                    }else{\r\n                        $and_sql = \" AND p.product_id NOT IN (SELECT product_id  FROM \" . DB_PREFIX . \"product_to_category)\";\r\n                    }\r\n                }\r\n\r\n                $sql .= \" WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\'\" . $and_sql;\r\n                /*** end owdAdminProductsByCategoryFilter ***/\r\n            ]]></add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[$sql .= \" WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\'\";]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                if (isset($data[\'filter_category\']) && $data[\'filter_category\'] !== \'\' && $data[\'filter_category\'] !== \'no_cat\') {\r\n                    $sql .= \" LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p.product_id = p2c.product_id)\";\r\n                }\r\n                ]]></add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[$sql .= \" WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\'\";]]></search>\r\n            <add position=\"after\"><![CDATA[\r\n                if (isset($data[\'filter_category\']) && $data[\'filter_category\'] !== \'\') {\r\n                    if ($data[\'filter_category\'] == \'no_cat\') {\r\n                        $sql .= \" AND p.product_id NOT IN (SELECT product_id  FROM \" . DB_PREFIX . \"product_to_category)\";\r\n                    }else{\r\n                        $sql .= \" AND p2c.category_id = \'\" . $this->db->escape($data[\'filter_category\']) . \"\'\";\r\n                    }\r\n                }\r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n\r\n    <file path=\"admin/view/template/catalog/product_list.twig\">\r\n        <operation>\r\n            <search><![CDATA[<label class=\"control-label\" for=\"input-name\">{{ entry_name }}</label>]]></search>\r\n            <add position=\"before\" offset=\"1\">\r\n                <![CDATA[\r\n                <div class=\"form-group\">\r\n                    <label class=\"control-label\" for=\"filter-category\">{{ text_category }}&nbsp;<a href=\"https://www.buymeacoffee.com/D0daCsFcQ\" target=\"_blank\" data-toggle=\"tooltip\" title=\"Buy coffee for developer\"><i class=\"fa fa-coffee\"></i></a>&nbsp;<a href=\"https://www.paypal.com/donate?hosted_button_id=9UMF6UF387DLN\" target=\"_blank\" data-toggle=\"tooltip\" title=\"Make donation\"><i class=\"fa fa-paypal\"></i></a></label>\r\n                    <select name=\"filter_category\" id=\"filter-category\" class=\"form-control\">\r\n                    {% if categories %}\r\n                        <option value=\"\">All categories</option>\r\n                        {% for category in categories %}\r\n                        <option value=\"{{ category.category_id }}\"{% if category.category_id == filter_category %} selected=\"selected\"{% endif %}>{{ category.name }}</option>\r\n                        {% endfor %}\r\n                    {% endif %}\r\n                </select>\r\n                </div>\r\n                ]]>\r\n            </add>\r\n        </operation>\r\n        <operation>\r\n            <search><![CDATA[var filter_model = $(\'input[name=\\\'filter_model\\\']\').val();]]></search>\r\n            <add position=\"before\" offset=\"1\">\r\n                <![CDATA[\r\n                var filter_category = $(\'select[name=\\\'filter_category\\\']\').val();\r\n\r\n                if (filter_category !== \'\') {\r\n                    url += \'&filter_category=\' + encodeURIComponent(filter_category);\r\n                }\r\n                ]]>\r\n            </add>\r\n        </operation>\r\n    </file>\r\n\r\n</modification>', 0, '2023-03-24 11:15:13'),
(12, 17, 'Discounts Pack', 'discountspack-jorimvanhove', 'Jorim van Hove', '1.5.2.0', 'http://www.jorimvanhove.com/plugins/discounts-pack', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n  <name>Discounts Pack</name>\n  <code>discountspack-jorimvanhove</code>\n  <version>1.5.2.0</version>\n  <author>Jorim van Hove</author>\n  <link>http://www.jorimvanhove.com/plugins/discounts-pack</link>\n  \n  <!-- Admin -->\n  <file path=\"admin/controller/common/column_left.php\">\n    <operation>\n      <search><![CDATA[if ($this->user->hasPermission(\'access\', \'catalog/download\')) {]]></search>\n  		<add position=\"before\"><![CDATA[\n  		\n  		// Discounts\n		$discounts = array();\n		\n		if ($this->user->hasPermission(\'access\', \'extension/module/discounts_pack/discount_category\')) {\n			$discounts[] = array(\n				\'name\'     => $this->language->get(\'text_category\'),\n				\'href\'     => $this->url->link(\'extension/module/discounts_pack/discount_category\', \'user_token=\' . $this->session->data[\'user_token\'], true),\n				\'children\' => array()	\n			);\n		}\n  		\n		$catalog[] = array(\n			\'name\'	   => $this->language->get(\'tab_discount\'),\n			\'href\'     => \'\',\n			\'children\' => $discounts		\n		);\n  		]]></add>\n    </operation>\n  </file>\n  <!-- // Admin -->\n  \n  <!-- Catalog -->\n  <!-- Include Specials -->\n  <file path=\"catalog/controller/product/special.php\">\n    <operation>\n      <search index=\"0\"><![CDATA[$results = $this->model_catalog_product->getProductSpecials($filter_data);]]></search>\n  		<add position=\"after\"><![CDATA[\n  		if (!empty($this->config->get(\'module_discounts_pack_include_specials\')) && !empty($this->config->get(\'module_discounts_pack_status\'))) {\n  			$this->load->model(\'extension/module/discount\');\n  			\n  			$results = $this->model_catalog_product->getProductSpecials([\'sort\' => $filter_data[\'sort\'], \'order\' => $filter_data[\'order\'], \'start\' => 0, \'limit\' => 0]);\n  			list($results, $product_total) = $this->model_extension_module_discount->getDiscountProducts($filter_data, $results, $product_total);\n\n  		}\n  		]]></add>\n    </operation>\n  </file>\n  \n  <file path=\"catalog/model/catalog/product.php\">\n    <operation>\n      <search index=\"0\"><![CDATA[if ($query->num_rows) {]]></search>\n  		<add position=\"after\"><![CDATA[\n  		if ($this->config->get(\'module_discounts_pack_status\')) {\n  			$this->load->model(\'extension/module/discount\');\n  			$query->row[\'special\'] = $this->model_extension_module_discount->specialPriceOverride($query->row[\'product_id\'],$query->row[\'special\'],$query->row[\'price\'],$query->row[\'discount\'],$this->config->get(\'config_customer_group_id\'));\n  		}  		\n  		]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[$query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"product_discount]]></search>\n  		<add  position=\"before\" ><![CDATA[\n  		if ($this->config->get(\'module_discounts_pack_status\')) {\n  			$this->load->model(\'extension/module/discount\');\n  			return $this->model_extension_module_discount->discountPriceOverride($product_id, $this->config->get(\'config_customer_group_id\'));\n  		} else {\n  		]]></add>\n    </operation> \n    <operation>\n      <search><![CDATA[$query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"product_discount]]></search>\n  		<add position=\"after\" ><![CDATA[\n  		}\n  		]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[foreach ($product_option_value_query->rows as $product_option_value) {]]></search>\n  		<add  position=\"after\" ><![CDATA[\n  		if ($this->config->get(\'module_discounts_pack_status\')) {\n  			$this->load->model(\'extension/module/discount\');\n  			$priceOverride = $this->model_extension_module_discount->specialPriceOverride($product_id,null,$product_option_value[\'price\'],null,$this->config->get(\'config_customer_group_id\'));\n  			if (!empty($priceOverride)) {\n  			    $product_option_value[\'price\'] = $priceOverride;\n  			}\n  		}  	\n  		]]></add>\n    </operation>          \n  </file>  \n  <file path=\"system/library/cart/cart.php\">\n    <operation>\n      <search><![CDATA[ // Product Discounts]]></search>\n  		<add position=\"after\" ><![CDATA[		\n  		if ($this->config->get(\'module_discounts_pack_status\')) {\n  			$override = $this->config->get(\'module_discounts_pack_override_discount_price\');\n  			if ($override == \'override\') {\n  				$discount_status = true;\n  			}\n  		}\n  		]]></add>\n    </operation>\n   <operation>\n      <search><![CDATA[$price = $product_discount_query->row[\'price\'];]]></search>\n  		<add position=\"before\" ><![CDATA[\n  		if (empty($discount_status)) {\n  		]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[$price = $product_discount_query->row[\'price\'];]]></search>\n  		<add position=\"after\" ><![CDATA[\n  		}\n  		]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[// Product Specials]]></search>\n  		<add position=\"after\"><![CDATA[		\n  		if ($this->config->get(\'module_discounts_pack_status\')) {\n  			$override = $this->config->get(\'module_discounts_pack_override_special_price\');\n  			if ($override == \'override\') {\n  				$special_status = true;\n  			}\n  		}\n  		]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[$price = $product_special_query->row[\'price\'];]]></search>\n  		<add position=\"before\" ><![CDATA[\n  		if (empty($special_status)) {\n  		]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[$price = $product_special_query->row[\'price\'];]]></search>\n  		<add position=\"after\" ><![CDATA[\n  		}\n  		]]></add>\n    </operation> \n  </file>\n  <!-- JOURNAL 3 -->\n  <file path=\"catalog/model/journal3/product.php\">\n    <operation error=\"skip\">\n      <search index=\"0\"><![CDATA[foreach ($query->rows as $row) {]]></search>\n  		<add position=\"after\"><![CDATA[\n  		if ($this->config->get(\'module_discounts_pack_status\')) {\n  			$this->load->model(\'extension/module/discount\');\n  			$row[\'special\'] = $this->model_extension_module_discount->specialPriceOverride($row[\'product_id\'],$row[\'special\'],$row[\'price\'],$row[\'discount\'],$this->config->get(\'config_customer_group_id\'));\n  		}  		\n  		]]></add>\n    </operation>      \n  </file>\n  <file path=\"catalog/controller/journal3/price.php\">\n    <operation>\n      <search><![CDATA[// stock status]]></search>\n  		<add position=\"before\"><![CDATA[\n  		if ($options_price && $this->config->get(\'module_discounts_pack_status\')) {\n			$this->load->model(\'extension/module/discount\');\n			$discountedOptionsPrice = $this->model_extension_module_discount->specialPriceOverride($product_id, null, $options_price, null,$this->config->get(\'config_customer_group_id\'));\n			\n			if ($discountedOptionsPrice) {\n			    $options_price = $discountedOptionsPrice;\n			}\n		}\n  		]]></add>\n    </operation>\n  </file>\n  <!-- JOURNAL 3 -->\n  <!-- // Catalog -->\n</modification>', 1, '2023-12-18 11:57:03');
